import styled from "styled-components"
import Logo from "./Logo/logo"

const HeaderInicioStyled = styled.header`
    display: flex;
    align-items: center;
    justify-content: space-between;
`

function Header () {
    return (
        <HeaderInicioStyled>
            <Logo />
        </HeaderInicioStyled>
    )
}

export default Header
